import logo from '../assets/logo.png';
<img src={logo} alt="SignBridge Logo" className="h-8 w-auto rounded" />
import React from 'react';
import { Link } from 'react-router-dom';


function Navbar() {
  return (
    <nav className="bg-blue-600 text-white flex flex-col md:flex-row items-center justify-between px-4 py-3 shadow-md rounded-b-lg">

<div className="flex items-center space-x-2">
  
  <span className="font-bold text-xl tracking-wide">SignBridge</span>
</div>

      <div className="flex space-x-4 mt-2 md:mt-0">
      <Link to="/">Dashboard</Link>
      <Link to="/upload">Upload Lessons</Link>
      <Link to="/profile">Profile</Link>
      <Link to="/interest-form">Apply as Instructor</Link>

      </div>

    </nav>
  );
}

export default Navbar;
